import React from "react";
import { ReactElement } from "react";
import Button from "../Button.tsx";

let NewWorkout = (): ReactElement => {

  const num = 4;
  const speed = 40;
  return (
    <>
      <div className="caption">Workout Details</div>

      <div className="default-div" style={{ fontSize: "2.5em", textAlign: "start", marginLeft: "1em", marginBottom: "2em" }}>
        <div className="default-div">{num} sets</div>
        <div className="default-div">{speed} seconds/set</div>
      </div>

      <div className="flex-row default-div" style={{ marginLeft: "4em" }}>
        <input type="text" style={{ fontSize: "2em", width: "10em" }}></input>
        <div className={`button-grow center-contents thin-rect-button`}>
          Save
        </div>
      </div>

      Start
      <Button margin="0em 1em 0em auto" location="/" text="Start" type="thin-rect-button"></Button>
    </>
  );
}

export default NewWorkout;
